/*Table structure for table `payments` */

DROP TABLE IF EXISTS `payments`;

CREATE TABLE `payments` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `date` date DEFAULT NULL,
  `amount` double DEFAULT NULL,
  `remaining_balance` double DEFAULT NULL,
  `ticket_id` bigint(20) unsigned DEFAULT NULL,
  `on_visit` tinyint(1) DEFAULT 0,
  `refund` tinyint(1) DEFAULT 0,
  `payment_left` int(11) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `month_index` int(11) DEFAULT NULL,
  `date_due` date DEFAULT NULL,
  `input_by` int(11) DEFAULT NULL,
  `previous_balance` double DEFAULT NULL,
  `proccess` tinyint(1) NOT NULL DEFAULT 0,
  `order` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`),
  KEY `payments_ticket_id_foreign` (`ticket_id`),
  CONSTRAINT `payments_ticket_id_foreign` FOREIGN KEY (`ticket_id`) REFERENCES `tickets` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

